import React from 'react';
import './HomeContenedor.css';

const Home = () => {
    return (
        <section className='contenedorprincipal'>
            <div className='contenedorhome'>
                <h1>Bienvido a la tienda Pokemon</h1>
                <p>
                    Contamos con estos dos productos:
                </p>
            </div>


            <div className='styleimg'>
                <div>

                        <img src="https://www.pngkey.com/png/detail/1-18288_play-pokemon-logo-pokemon-league.png" alt="Pokemon" />

                </div>


            </div>
        </section>
    );
}

export default Home;
